 class Welcome_c extends Component {
     constructor(props) {
         super(props)


             this.state= {date:new date()}

     }

    componentDidMount(){

        this.timerId = setInterval(
            () => this.tick(),
            1000
        )

        this.setState = tick()

    }

    componentDidUnMount(){
       clearInterval(this.timerId)
    }

     tick(){
      this.setState({
          date:newDate()
      })
    }

    render() {
        return (
            <div>
                <h1>Hello, 2021</h1>
                <h2>It is {this.state.date.toLocaleDateString()}</h2>
            </div>
        )
    }
}

